import React, { useEffect } from "react";
import AllSongs from "./AllSongs";

function MusicMenu(props) {
  const { activeItemMenu } = props;
  const musicMenuItems = ["AllSongs", "Artists", "Albums"];
  return (
    <table id="music-menu">
      <tbody>
        <tr>
          <th className="table-heading">
            Music <i className="fas fa-music"></i>
          </th>
        </tr>
        {musicMenuItems.map((activeItemMenu, index) => (
          <tr data-option={activeItemMenu}
          className={index==activeItemMenu?"active":""}>
            <td className="table-item" key={index} >
              {activeItemMenu}
              <i className="fas fa-chevron-right"></i>
            </td>
          </tr>
        ))}
        {/* <tr data-option="allSongs">
            <td className="table-item">All Songs<i className="fas fa-chevron-right"></i></td> 
        </tr>
        <tr data-option="artists">
            <td className="table-item">Artists<i className="fas fa-chevron-right"></i></td>
        </tr>
        <tr data-option="albums">
            <td className="table-item">Albums<i className="fas fa-chevron-right"></i></td>
        </tr> */}
      </tbody>
    </table>
  );
}

export default MusicMenu;
